import Dashboard from "./Components/Dashboard";
import ForgotPassword from "./Components/ForgotPassword";
import Login from "./Components/Login";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import UserManagement from "./Components/UserManagement";
import ListenerMangement from "./Components/ListenerMangement";
import CategoryManagement from "./Components/CategoryManagement";
import PromoCodeManagement from "./Components/PromoCodeManagement";
function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/forgotpassword" element={<ForgotPassword />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/user-management" element={<UserManagement />} />
          <Route path="/listener-management" element={<ListenerMangement />} />
          <Route path="/category-management" element={<CategoryManagement/>} />
          <Route path="/promocode-management" element={<PromoCodeManagement/>} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
